import React from "react";
import Heading from "./Heading";
import Car from "./Car";
import carList from "./CarDictionary";

function carMapping(names){
    return <Car 
        key={names.id}
        car={names.name}
    />;
}


function doSomething(){
    var newCar = {
        id:5,
        name:"Yes"
    };
    carList.push(newCar);
}

function List(){
    return <div>
        <Heading />
        <button onClick={doSomething}>Add</button>
        <ul>
            {carList.map(carMapping)}
        </ul>

    </div>;
}

export default List;
